script: |
  super -f text -I q9600.spq | sort > q9600.out

inputs:
  - name: q9600.spq
    data: |
      SELECT cor0.col0 * cor0.col0 FROM tab1 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q9600.out
    data: |
      4096
      4096
      4096
      6400
      6400
      6400
      9
      9
      9
